 has gone through a high-speed evolution with an impact in almost every corner of our society. \n\nAt first for fun, mathematicians and computer scientists embraced this field and produced sophisticated, seemingly impossible models. A black forest cuckoo or the Paris cathedral – all made from just one sheet of paper. These origami freaks eventually discovered that with origami they could fold anything, create any 3D object, providing the sheet of paper was large enough. Looking at these developments, biologists wondered whether origami wouldn’t be in fact an attempt to imitate nature. And indeed, everything that develops and changes in nature is folded: mountains, blossoms, the brain… Life is an unending series of folding and unfolding. It’s the most economical and efficient process in the natural world. And it is not only design. Folding determines also function. \n\nToday researchers in robotics, medicine, biology, nanotechnologies, are embracing this “origami philosophy”. They are looking at how materials and molecules wrinkle, drape, flex and crease, refining origami techniques, and trying better to understand and duplicate nature’s universal folding principles. The Origami Code explores this silent deciphering and mastering of a completely new dimension of reality. The film explores how the ancient art of folding paper has entered the cutting-edge domains of research and now could lead the way to the ultimate stage in bionics.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #origami \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineerin ophy”. They are looking at how materials and molecules wrinkle, drape, flex and crease, refining origami techniques, and trying better to understand and duplicate nature’s universal folding principles. The Origami Code explores this silent deciphering and mastering of a completely new dimension of reality. The film explores how the ancient art of folding paper has entered the cutting-edge domains of research and now could lead the way to the ultimate stage in bionics.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #origami \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries on engineering."},"lengthSeconds":"3116","ownerProfileUrl":"http://www.youtube.com/@FD_Engineering","externalChannelId":"UCKFjNynYRgDfnSIXzELPqTA","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN","BO","BQ","BR","BS","BT","BV","BW","BY","BZ","CA","CC","CD","CF","CG","CH","CI","CK","CL","CM","CN","CO","CR","CU","CV","CW","CX","CY","CZ","DE","DJ","DK","DM","DO","DZ","EC","EE","EG","EH","ER","ES","ET","FI","FJ","FK","FM","FO","FR","GA","GB","GD","GE","GF","GG","GH","GI","GL","GM","GN","GP","GQ","GR","GS","GT","GU","GW","GY","HK","HM","HN","HR","HT","HU","ID","IE","IL","IM","IN","IO","IQ","IR","IS","IT","JE","JM","JO","JP","KE","KG","KH","KI","KM","KN","KP","KR","KW","KY","KZ","LA","LB","LC","LI","LK","LR","LS","LT","LU","LV","LY","MA","MC","MD","ME","MF","MG","MH","MK","ML","MM","MN","MO", I4-f0pKrugAMVxcjVCh2k7w_4","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CK4DEM2rARgBIhMI4-f0pKrugAMVxcjVCh2k7w_4","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"From Paper to Bionics: Origami's Incredible Impact on Science | The Origami Code | FD Engineering\n\nWatch 'Technologies of the Coming Century' here:    • Technologies of the Coming Century | ...  \n\nIn Japan, every pupil learns origami: a square sheet of paper is shaped into a frog or a lotus flower. No cuts, no glue – just folds. But in the last twenty years, this ancient art of folding has gone through a high-speed evolution with an impact in almost every corner of our society. \n\nAt first for fun, mathematicians and computer scientists embraced this field and produced sophisticated, seemingly impossible models. A black forest cuckoo or the Paris cathedral – all made from just one sheet of paper. These origami freaks eventually discovered that with origami they could fold anything, create any 3D object, providing the sheet of paper was large enough. Looking at these developments, biologists wondered whether origami wouldn’t be in fact an attempt to imitate nature. And indeed, everything that develops and changes in nature is folded: mountains, blossoms, the brain… Life is an unending series of folding and unfolding. It’s the most economical and efficient process in the natural world. And it is not only design. Folding determines also function. \n\nToday researchers in robotics, medicine, biology, nanotechnologies, are embracing this “origami philosophy”. They are looking at how materials and molecules wrinkle, drape, flex and crease, refining origami techniques, and trying better to understand and duplicate nature’s universal folding principles. The Origami Code explores this silent bject, providing the sheet of paper was large enough. Looking at these developments, biologists wondered whether origami wouldn’t be in fact an attempt to imitate nature. And indeed, everything that develops and changes in nature is folded: mountains, blossoms, the brain… Life is an unending series of folding and unfolding. It’s the most economical and efficient process in the natural world. And it is not only design. Folding determines also function. \n\nToday researchers in robotics, medicine, biology, nanotechnologies, are embracing this “origami philosophy”. They are looking at how materials and molecules wrinkle, drape, flex and crease, refining origami techniques, and trying better to understand and duplicate nature’s universal folding principles. The Origami Code explores this silent deciphering and mastering of a completely new dimension of reality. The film explores how the ancient art of folding paper has entered the cutting-edge domains of research and now could lead the way to the ultimate stage in bionics.\n▬▬▬▬▬▬▬▬▬\nSubscribe Free Documentary - Engineering Channel for free: https://bit.ly/FDEngineering\nInstagram: https://instagram.com/free.documentary/\nFacebook: https://bit.ly/2QfRxbG\nTwitter: https://bit.ly/2QlwRiI\n▬▬▬▬▬▬▬▬▬\n#FreeDocumentary #Documentary #origami \n▬▬▬▬▬▬▬▬▬\n“Engineering: the branch of science and technology concerned with the design, building and use of engines, machines and structures.” So says the Webster definition. Our newest Free Documentary family member Free Documentary - Engineering is all about engineering - and bringing our community the best documentaries on engineering.","commandRuns":[{"startIndex":148,"length":47,"onTap":{"innertubeCommand":{"clickTrackingParams":"CCsQ040EGAMiEwjj5_Skqu6AAxXFyNUKHaTvD_g=","commandMetadata":{"webCommandMetadata":{"url":"/watch?v=rAYRLxb1le0\u0026t=0s","webPageType":"WEB_PAGE_TYPE_WATCH","rootVe":3832}},"watchEndpoint":{"videoId":"rAYRLxb1le0","startTimeSeconds":0,"watchEndpointSup
